import React, { Component } from "react";

class App extends Component {
  render() {
    return (
      <div>
        <h1>HELLO DOJO!</h1>
        <p>Things i need to do:</p>
        <ul>
          <li>Learn React</li>
          <li>Climb Mt. Everest</li>
          <li>Run a marathon</li>
          <li>Feed the dogs</li>
        </ul>
      </div>
    );
  }
}

export default App;
